#include <bits/stdc++.h>
class Solution
{
public:
    int findMaxConsecutiveOnes(std::vector<int> &nums)
    {
        int count = 0;
        int max = 0;
        for (int i = 0; i < nums.size(); i++)
        {
            if (nums[i] == 1)
            {
                count++;
            }
            else
            {
                if (max < count)
                {
                    max = count;
                }
                count = 0;
            }
        }
        if (max < count)
        {
            max = count;
            count = 0;
        }
        return max;
    }
};
